import React from 'react';

function WorkExperience() {
  return (
    <div className="work-experience">
      <h1>Work Experience</h1>
      <h3><strong>CrossAngle | </strong><em>Blockchain Partner Researcher</em></h3>
      <ul>
        <li>CrossAngle content</li>
      </ul>
      <p><strong>FourPillars</strong> <strong>|</strong> <em>Blockchain Partner Researcher</em></p>
      <ul>
        <li>FourPillars content</li>
      </ul>
    </div>
  );
}

export default WorkExperience;
